query.query:
query {
  comments {
    data {
      id
      name
      email
    }
  }
}

query {
  comments(options: { paginate: { page: 1, limit: 10 } } ) {
    data {
      id
      name
      email
      body
      post {
        id
        title
      }
    }
  }
}

